    private class GetXMLTask extends AsyncTask<String, Void, Document[]> {

        ProgressDialog asyncDialog = new ProgressDialog(MapsActivity.this);

        @Override
        protected void onPreExecute() {
            super.onPreExecute();
            asyncDialog.setProgressStyle(ProgressDialog.STYLE_SPINNER);
            asyncDialog.setMessage("로딩중입니다..");
            asyncDialog.show();
        }
        @Override
        protected Document[] doInBackground(String... urls) {
            URL url;
            try {
                for(int i=0;i<urls.length;i++) {
                    url = new URL(urls[i]);
                    DocumentBuilderFactory dbf = DocumentBuilderFactory.newInstance();
                    DocumentBuilder db = dbf.newDocumentBuilder();
                    doc[i] = db.parse(new InputSource(url.openStream()));
                    doc[i].getDocumentElement().normalize();
                }
            } catch (Exception e) {
                Toast.makeText(getBaseContext(), "Parsing Error", Toast.LENGTH_SHORT).show();
            }
            return doc;
        }
        @Override
        public void onPostExecute(Document[] doc) {
            for(int j=0;j<doc.length;j++) {
                if(j==0) {
                    NodeList nodeList = doc[j].getElementsByTagName("item");
                    for(int i = 0; i < nodeList.getLength(); i++){
                        Node node = nodeList.item(i);
                        Element fstElmnt = (Element) node;
                        NodeList nameList  = fstElmnt.getElementsByTagName("stationName");
                        NodeList pm10Value = fstElmnt.getElementsByTagName("pm10Value");
                        Element nameElement = (Element) nameList.item(0);
                        nameList = nameElement.getChildNodes();
                        pm10HashMap.put(((Node) nameList.item(0)).getNodeValue(), pm10Value.item(0).getChildNodes().item(0).getNodeValue());
                    }
                }else {
                    NodeList nodeList = doc[j].getElementsByTagName("item");
                    for (int i = 0; i < nodeList.getLength(); i++) {
                        Node node = nodeList.item(i);
                        Element fstElmnt = (Element) node;
                        NodeList nameList = fstElmnt.getElementsByTagName("cityName");
                        NodeList pm10Value = fstElmnt.getElementsByTagName("pm10Value");
                        Element nameElement = (Element) nameList.item(0);
                        nameList = nameElement.getChildNodes();
                        pm10HashMap.put(((Node) nameList.item(0)).getNodeValue(), pm10Value.item(0).getChildNodes().item(0).getNodeValue());
                    }
                }
            }
            draw();
            draw2();
            asyncDialog.dismiss();
        }
    }


    private void addIcon(IconGenerator iconFactory, String text, LatLng position) {
        Marker marker;
        MarkerOptions markerOptions = new MarkerOptions().
                icon(BitmapDescriptorFactory.fromBitmap(iconFactory.makeIcon(text))).
                position(position).
                anchor(iconFactory.getAnchorU(), iconFactory.getAnchorV());
        markerOptions.visible(false);
        marker = mMap.addMarker(markerOptions);
        markerList.add(marker);
    }
